import React from 'react'
import "./front.css";

const Front = () => {
    return (
       <>
       <div className="Header">
           <h3>NFT Marketplace</h3>
           <hr/>
       </div>
       <div className="Footer">
        <p>this is some content</p>
       </div>
       </>
    )
}
export default Front
